  //yeh fun k andar nhi likhte top pr likhte hai hamesha ðŸ‘‡
  const [addItem,setAdditem] = useState([]);
  const addNote = (note) => {
    // alert("i am clicked");
    setAdditem((prevData) => {
      return [...prevData,note]
    })
  };

  return (
    <>
      <Header />
      <CreateNote
        passNote = {addNote}
       />
      <Note />
      <Footer />
    </>
  )
}
export default App;
